const Footer = () => {
  return (
    <div className='footer'>
      <div className='container'>
        <div className='row'>
          <div className='col-lg-4 col-md-6 col-sm-6'>
            <div className='d-flex'>
              <p>surendra.kalluri1997@gmail.com</p>
            </div>
            <div className='d-flex'>
              <a href='tel:512-998-4240'>+1 (512)-998-4240</a>
            </div>
          </div>
          .col-lg-3.col-md-2
        </div>
      </div>
    </div>
  );
};

export default Footer;
